import {TextInput,Button} from "react-native"
import './App.css';
import _ from "lodash"
import {useState} from "react"

function App() {
let zer="";
let [result,setResult]= useState;
  return (
    <div className="App">
      <body>
        <TextInput
          multiline={true}
          numberOfLines={10}
          style={{ height: 500,width:950,borderStyle: "solid", borderWidth:2 }} 
          onChange={function(event){
              zer=event.target.value;
              console.log(zer)
        }
        }>
        </TextInput>
      </body>
      <Button onPress={function(){
        console.log(result);
        let strings = zer.split("\n");
        let times = [];
        let sum = 0;
        let days = [];
        _.each(strings, s => {
          let t;
          if (s.split(" = ")[1]) {
            t = s.split(" = ")[1].split(":");
            t = parseInt(t[2]) + parseInt(t[1]) * 60 + parseInt(t[0]) * 60 * 60;
            sum += t;
            times.push(t);
          }
          if (s.split("	")[1]) {
            let date = new Date(Date.parse(s.split("	")[1]));
            let day = date.getDay();
            if (day != 0 && day != 6) {
              days.push(date);
            }
          }
        });

        let h = Math.floor(sum / (60 * 60));
        let s = (sum % (60 * 60));
        let m = Math.floor(s / 60);
        s = s - m * 60;
        console.log(h, ":", m, ":", s);
        console.log("days count", days.length);
        console.log("hours norma", days.length * 8.5);

        setResult = ({
          totalTime: h + ":" + m + ":" + s,
          daysCount: days.length,
          hours_norma: days.length * 8.5
        });
      }}>Нажми меня!</Button>
      <div id="totalTime">result.totalTime</div>
      <div id="daysCount">result.daysCount</div>
      <div id="hours_norma">result.hours_norma</div>
    </div>

  );
}

export default App;
